    [Parameter]
    public string id { get; set; }
    InventorySetting setting = new InventorySetting();
    Privilege privi = new Privilege();
    IncomeMaster mster = new IncomeMaster();
    List<IncomeExpenditureView> product = new List<IncomeExpenditureView>();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    long decIncomeVoucherTypeId = 31;
    string strMenu = "SalesInvoice";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    string companyName;
    string address;
    string phone;
    string billtype;
    protected async override void OnInitialized()
    {
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        var resultCompany = icompany.ViewCompany(CompanyId);
        companyName = resultCompany.CompanyName;
        address = resultCompany.Address;
        phone = resultCompany.Phone;
        billtype = "Income Voucher";
        setting = settingRepository.EditInventorySetting(decIncomeVoucherTypeId);
        mster = incomeVoucher.EditIncomeMaster(Convert.ToInt64(id));
        product = expenVoucher.ViewIncomeShowPrint(Convert.ToInt64(id));
        StateHasChanged();
    }
    private void Print()
    {
        JsRuntime.InvokeVoidAsync("Print");
    }

